import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";
import { getAuth } from "firebase/auth";

const firebaseConfig = {
  apiKey: "AIzaSyBnDaJi7U3ZGQKa8Lp07OaoZPbPJiE4lhw",
  authDomain: "whatif-backend.firebaseapp.com",
  projectId: "whatif-backend",
  storageBucket: "whatif-backend.firebasestorage.app",
  messagingSenderId: "179232866301",
  appId: "1:179232866301:web:0990e11a14da4f940ee394",
  measurementId: "G-19MRXPSJVW"
};

// Initialize Firebase App
const app = initializeApp(firebaseConfig);

// Analytics (optional)
const analytics = getAnalytics(app);

// Auth instance
const auth = getAuth(app);

// Optional for your debug button
window.auth = auth;
window.getIdToken = () => auth.currentUser?.getIdToken().then(token => console.log("Your fresh ID Token:", token));

// Correct export
export { app, auth, analytics };
